import styles from "./ChatPage.module.css";
import React, { useState, useEffect } from "react";
import ChatBox2 from "../../components/CHAT/ChatBox/ChatBox";
import RoomsList from "../../components/CHAT/RoomsList/RoomsList";

const ChatPage = () => {
  const [currentFriend, setCurrentFriend] = useState();
  return (
    <div className={styles.container}>
      <div className={styles.ChatandFriendContainer}>
        <div className={styles.RoomsList}>
          <RoomsList
            setCurrentFriend={setCurrentFriend}
            currentFriend={currentFriend}
          />
        </div>
        <div className={styles.ChatBox2}>
          <ChatBox2 currentFriend={currentFriend} />
        </div>
      </div>
    </div>
  );
};

export default ChatPage;
